import { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const res = await axios.get(
          "https://jsonplaceholder.typicode.com/users"
        );
        setUsers(res.data);
      } catch (error) {
        console.log("error");
      }
    };
    fetchData();
  }, []);

  return <>

    <ul>
      {users.map()}
    </ul>
  </>;
}

export default App;
